#include <stdio.h>
#include <stdlib.h>
#include <time.h>

#define NUMS 1000000

typedef struct node
{
 int payload;
 struct node *left;
 struct node *right;
} 
node_t;

node_t *insert(node_t *r, int n);
void print( node_t *r, int *pMax);

int main()
{
 node_t *root = NULL;
 int max_to_print = 20; 

 clock_t t = clock();
 int i;
 for ( i = 0; i < NUMS; ++i ) 
 {
 root = insert( root, rand());
 }
 t = clock() - t;
 print( root, &max_to_print);
 printf("\n clock: %d == %f sec", (int)t, (double)t/CLOCKS_PER_SEC);
 return 0;
}
